import logo from './components/images/skydive.jpg';
import './App.css';

import {
  Box,
  Container,
  Row,
  Column,
  FooterLink,
  Heading,
  Imgaging,
  StartButton,
} from "./AppStyles";


function App()  {
  return (
    <Box>
      <Container>
        <Row>
          <Column>
            <Heading>====</Heading>
            <Heading>Find yur next perfect trip</Heading>
            <input type="text"
            value={this.state.value}
            onChange={this.handleChange}
         />
            <StartButton>Search</StartButton>
          </Column>
        </Row>
       </Container>
    </Box>
  );
}

export default App;
